.x-integrity .container-pages-features {
  text-align: center;
}

.x-integrity .container-pages-shortcodes .p-pages,
.x-integrity .container-pages-features .p-pages {
  max-width: 700px;
  margin-left: auto;
  margin-right: auto;
}

.x-integrity .container-pages-pages .p-pages {
